<!--Q.33Write a JavaScript program to compare two objects?-->

<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        var obj1={
          age:15,
          dob:16/9/2009,
        };
        var obj2={
          age:37,
          dob:16/5/1987,
        };
        console.log(obj1==obj2);
        console.log(obj1===obj2);
        </script>
</body>
</html>
